package main

import (
	"fmt"
	"testing"
)

func TestSolution(t *testing.T) {
	type testCase struct {
		s    string
		k    int
		Want int
	}

	testGroup := []testCase{
		{"", 32701, 98317},
		{"cbaabccac", 3, -1},
		{"aabaaaacaabc", 2, 8},
		{"a", 0, 0},
	}

	for i, v := range testGroup {
		result := takeCharacters(v.s, v.k)
		if result != v.Want {
			t.Fatalf("%d, v %v expect '%v' but '%v'", i, v, v.Want, result)
		}
		fmt.Println(i, "result", result)
	}
}
